def func(head):
    """
    linked 자료형 구조는 하나씩 입력되는 데이터입니다.
    즉, 현재까지 들어온 자료에 대해선 알아도 앞으로 어떤 자료가 들어올지에 대한 정보는 모르는채로 알고리즘이 돌아갑니다.
    """
    rev = None # linked data의 역순이 저장될 공간입니다.
    slow = fast = head # 같은 출발점을 부여합니다.

    while fast and fast.next: # fast나 fast.next가 None값이 나오면 종료됩니다. 1 -> 2 -> None 이 남았을때는 작동하지만 None이나 1 -> None이라면 종료됩니다.
        fast = fast.next.next # slow는 1개씩, fast는 자료를 2개씩 불러옵니다. while문이 끝났을때 slow는 중간 +1(전체 데이터가 홀수) 혹은 중간(짝수)에 위치합니다.
        rev, rev.next, slow = slow, rev, slow.next

    if fast: # 위 while문의 조건에 의해 전체 데이터 갯수가 홀수인 경우 slow는 정가운데 있게 됩니다. (하단 참조)
        slow = slow.next
    
    while rev and rev.val == slow.val: # rev가 비거나 rev와 slow의 값이 다르면 종료됩니다. 즉, 팰린드롬이 아니면 rev가 남은 상태로 종료됩니다.
        slow, rev = slow.next, rev.next
    
    return not rev # rev가 남아있으면 False, 비어있으면 True를 반환합니다. rev가 남아있다는 것은 두번째 while문에 의해 팰린드롬이 아니라는 뜻입니다.

